var fileJSON=[{"path":"/data/vkhriste/test-regression/multifit_ocl/device/regression_inplace_fnnls_v1.cl", "name":"regression_inplace_fnnls_v1.cl", "has_active_debug_locs":true, "absName":"/data/vkhriste/test-regression/multifit_ocl/device/regression_inplace_fnnls_v1.cl", "content":"//\012// inplace fnnls.\012// for simplicity assume row major storage of all the matrices\012//\012\012//\012// definitions of constants\012//\012#define NUM_TIME_SAMPLES 10\012#define NUM_TIME_SAMPLES_SQ 100 \012// to easily switch between row major and column major matrix representations\012#define M_LINEAR_ACCESS(M, row, col) M[(row) * (NUM_TIME_SAMPLES) + (col)]\012typedef float data_type;\012#define SIMPLE_SQRT(x) sqrt(x)\012\012#define NNLS_LOCAL __local\012#define NNLS_GLOBAL __global\012#define NNLS_DEBUG\012#undef NNLS_DEBUG\012\012//\012// Various Matrix and Vector Multiplications \012// C = A * A_T -> the result is symmetric matrix.\012// the restult matrix C will be stored in column major\012//\012inline void transpose_multiply_m_m(__global data_type const* restrict A, \012                            NNLS_LOCAL data_type *restrict result);\012inline void transpose_multiply_m_v_v(__global data_type const * restrict M, \012                              __global data_type const * restrict v, \012                              NNLS_LOCAL data_type * restrict result);\012inline void multiply_m_v_v(NNLS_LOCAL data_type const * restrict M, \012                    NNLS_LOCAL data_type const * restrict v, \012                    NNLS_LOCAL data_type *restrict result);\012\012inline void transpose_multiply_m_m(__global data_type const* restrict A, \012                            NNLS_LOCAL data_type *restrict result) {\012#pragma loop_coalesce 2\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i) {\012        for (int j=i; j<NUM_TIME_SAMPLES; ++j) {\012            M_LINEAR_ACCESS(result, i, j) = 0;\012\012#pragma unroll 1\012            for (int k=0; k<NUM_TIME_SAMPLES; ++k)\012                M_LINEAR_ACCESS(result, i, j) += M_LINEAR_ACCESS(A, k, i) * \012                    M_LINEAR_ACCESS(A, k, j);\012            M_LINEAR_ACCESS(result, j, i) = M_LINEAR_ACCESS(result, i, j);\012       }\012    }\012}\012\012inline void transpose_multiply_m_v_v(__global data_type const *M, \012                              __global data_type const *v, \012                              NNLS_LOCAL data_type *restrict result) {\012#pragma loop_coalesce 2\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i) {\012        result[i] = 0;\012#pragma unroll 1\012        for (int k=0; k<NUM_TIME_SAMPLES; ++k) {\012            result[i] += M_LINEAR_ACCESS(M, k, i) * v[k];\012        }\012    }\012}\012\012inline void multiply_m_v_v(NNLS_LOCAL data_type const *M, \012                    NNLS_LOCAL data_type const *v, \012                    NNLS_LOCAL data_type *restrict result) {\012#pragma loop_coalesce 2\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i) {\012        result[i] = 0;\012#pragma unroll 1\012        for (int k=0; k<NUM_TIME_SAMPLES; ++k) \012            result[i] += M_LINEAR_ACCESS(M, i, k) * v[k];\012    }\012}\012\012//\012// Swap Functions\012//\012inline void swap_permm(NNLS_LOCAL data_type *permutation, int idx1, int idx2);\012inline void swap_row_column(NNLS_LOCAL data_type *pM, \012                     int i, int j, int full_size, int view_size);\012inline void swap_element(NNLS_LOCAL data_type *pv, int i, int j);\012inline void swap_perm_element(NNLS_LOCAL int *pv, int i, int j);\012\012inline void swap_element(NNLS_LOCAL data_type *pv,\012                  int i, int j) {\012    data_type tmp = pv[i];\012    pv[i] = pv[j];\012    pv[j] = tmp;\012}\012\012inline void swap_perm_element(NNLS_LOCAL int *pv,\012                       int i, int j) {\012    int tmp = pv[i];\012    pv[i] = pv[j];\012    pv[j] = tmp;\012}\012\012// same precondition: index_j > index_i\012#define SWAP_LOOP(start, finish, matrix, index_i, index_j) \\\012    for (int elem=start; elem<finish; ++elem) { \\\012        data_type tmp = M_LINEAR_ACCESS(matrix, index_i, elem); \\\012        M_LINEAR_ACCESS(matrix, index_i, elem) = \\\012            M_LINEAR_ACCESS(matrix, index_j, elem); \\\012        M_LINEAR_ACCESS(matrix, index_j, elem) = tmp; \\\012        M_LINEAR_ACCESS(matrix, elem, index_i) = \\\012            M_LINEAR_ACCESS(matrix, elem, index_j); \\\012        M_LINEAR_ACCESS(matrix, elem, index_j) = tmp; \\\012    }\012\012// precondition: j > i\012inline void swap_row_column(NNLS_LOCAL data_type *pM, \012                     int i, int j, int full_size, int view_size) {\012    // diagnoal\012    data_type tmptmp = M_LINEAR_ACCESS(pM, i, i);\012    M_LINEAR_ACCESS(pM, i, i) = M_LINEAR_ACCESS(pM, j, j);\012    M_LINEAR_ACCESS(pM, j, j) = tmptmp;\012\012#pragma ivdep\012    for (int elem=0; elem<NUM_TIME_SAMPLES; ++elem) {\012        if (elem==i || elem==j)\012            continue;\012\012        data_type tmp = M_LINEAR_ACCESS(pM, i, elem);\012        M_LINEAR_ACCESS(pM, i, elem) =\012            M_LINEAR_ACCESS(pM, j, elem);\012        M_LINEAR_ACCESS(pM, j, elem) = tmp;\012        M_LINEAR_ACCESS(pM, elem, i) =\012            M_LINEAR_ACCESS(pM, elem, j);\012        M_LINEAR_ACCESS(pM, elem, j) = tmp;\012    }\012\012/*\012#pragma unroll 1\012    SWAP_LOOP(0, i, pM, i, j)\012#pragma unroll 1\012    SWAP_LOOP(i+1, j, pM, i, j)\012#pragma unroll 1\012    SWAP_LOOP(j+1, NUM_TIME_SAMPLES, pM, i, j)\012*/\012}\012\012//\012// Cholesky Decomposition + Forward/Backward Substituion Solvers\012//\012inline void cholesky_decomp(NNLS_LOCAL data_type const* restrict pM,\012                     NNLS_LOCAL data_type * restrict pL,\012                     int full_size, int view_size);\012inline void fused_cholesky_forward_substitution_solver_rcadd(\012        NNLS_LOCAL data_type const * restrict pM, \012        NNLS_LOCAL data_type *restrict pL, \012        NNLS_LOCAL data_type const * restrict pb,\012        NNLS_LOCAL data_type *restrict py, \012        int full_size, int view_size);\012inline void fused_cholesky_forward_substitution_solver_inbetween_removal(\012        NNLS_LOCAL data_type const * restrict pM, \012        NNLS_LOCAL data_type *restrict pL, \012        NNLS_LOCAL data_type const * restrict pb, \012        NNLS_LOCAL data_type *restrict py, \012        int position, int full_size, int view_size);\012\012inline void cholesky_decomp(NNLS_LOCAL data_type const* restrict pM,  \012                     NNLS_LOCAL data_type *restrict pL, \012                     int full_size, int view_size) {\012    for (int i=0; i<view_size; ++i) {\012\012        // first compute elements to the left of the diagoanl\012        data_type sumsq = 0.0f;\012        for (int j=0; j<i; ++j) {\012\012            data_type sumsq2 = 0.0f;\012            for (int k=0; k<j; ++k) {\012                sumsq2 += M_LINEAR_ACCESS(pL, i, k) *\012                    M_LINEAR_ACCESS(pL, j, k);\012            }\012\012            // compute the i,j : i>j. elements to the left of the diagonal\012            M_LINEAR_ACCESS(pL, i, j) =\012                (M_LINEAR_ACCESS(pM, i, j) - sumsq2)\012                / M_LINEAR_ACCESS(pL, j, j);\012\012            // needed to compute diagonal element\012            sumsq += M_LINEAR_ACCESS(pL, i, j) *\012                M_LINEAR_ACCESS(pL, i, j);\012        }\012\012        // second, compute the diagonal element\012        M_LINEAR_ACCESS(pL, i, i) =\012            SIMPLE_SQRT(M_LINEAR_ACCESS(pM, i, i) - sumsq);\012    }\012}\012\012inline void fused_cholesky_forward_substitution_solver_rcadd(\012        NNLS_LOCAL data_type const *pM, \012        NNLS_LOCAL data_type *restrict pL, \012        NNLS_LOCAL data_type const *pb,\012        NNLS_LOCAL data_type *restrict py, \012        int full_size, int view_size) {\012    /*\012     * cholesky decomposition using partial computation\012     * only compute values in the row that was just added\012     */\012    data_type sum = 0.0f;\012    int row = view_size - 1;\012    data_type total = pb[row];\012    for (int col=0; col<row; ++col) {\012        data_type sum2 = 0;\012        for (int j=0; j<col; ++j) {\012            sum2 += M_LINEAR_ACCESS(pL, row, j) *\012                M_LINEAR_ACCESS(pL, col, j);\012        }\012\012        // compute the row,col : row > col. elements to the left of the diagonal\012        data_type value_row_col = (M_LINEAR_ACCESS(pM, row, col) - sum2)\012            / M_LINEAR_ACCESS(pL, col, col);\012\012        // update the sum needed for forward substitution\012        total -= value_row_col * py[col];\012\012        // needed to compute the diagonal element\012        sum += value_row_col * value_row_col;\012\012        // set the value\012        M_LINEAR_ACCESS(pL, row, col) = value_row_col;\012    }\012\012    // compute the diagonal value\012    data_type diag_value = SIMPLE_SQRT(M_LINEAR_ACCESS(pM, row, row)\012        - sum);\012    M_LINEAR_ACCESS(pL, row, row) = diag_value;\012\012    // compute the new value (view_size - 1 ) of the result of forward substitution\012//    __local data_type y_last = total / diag_value;\012    py[row] = total / diag_value;\012}\012\012inline void fused_cholesky_forward_substitution_solver_inbetween_removal(\012        NNLS_LOCAL data_type const *pM, \012        NNLS_LOCAL data_type *restrict pL, \012        NNLS_LOCAL data_type const *pb, \012        NNLS_LOCAL data_type *restrict py, \012        int position, int full_size, int view_size) {\012    // only for elements with >= position\012    for (int i=position; i<view_size; ++i) {\012\012        // first compute elements to the left of the diagoanl\012        data_type sumsq = 0.0f;\012        data_type total = pb[i];\012        for (int j=0; j<i; ++j) {\012\012            data_type sumsq2 = 0.0f;\012            for (int k=0; k<j; ++k) {\012                sumsq2 += M_LINEAR_ACCESS(pL, i, k) *\012                    M_LINEAR_ACCESS(pL, j, k);\012            }\012\012            // compute the i,j : i>j. elements to the left of the diagonal\012            data_type value_i_j =\012                (M_LINEAR_ACCESS(pM, i, j) - sumsq2)\012                / M_LINEAR_ACCESS(pL, j, j);\012            M_LINEAR_ACCESS(pL, i, j) = value_i_j;\012            total -= value_i_j * py[j];\012\012            // needed to compute diagonal element\012            sumsq += value_i_j * value_i_j;\012        }\012\012        // second, compute the diagonal element\012        data_type value_i_i =\012            SIMPLE_SQRT(M_LINEAR_ACCESS(pM, i, i) - sumsq);\012        M_LINEAR_ACCESS(pL, i, i) = value_i_i;\012\012        // compute the i-th solution value for forward sub\012        py[i] = total / value_i_i;\012    }\012}\012\012inline void solve_forward_substitution(NNLS_LOCAL data_type const *pM, \012                                NNLS_LOCAL data_type const* pb, \012                                NNLS_LOCAL data_type *restrict psolution,\012                                int full_size, int view_size);\012inline void solve_forward_substitution(NNLS_LOCAL data_type const *pM, \012                                NNLS_LOCAL data_type const* pb, \012                                NNLS_LOCAL data_type *restrict psolution,\012                                int full_size, int view_size) {\012    // very first element is trivial\012    psolution[0] = pb[0] / pM[0];\012\012    // for the rest\012    for (int i=1; i<view_size; ++i) {\012        data_type total = pb[i];\012        for (int j=0; j<i; j++) {\012            total -= M_LINEAR_ACCESS(pM, i, j) * psolution[j];\012        }\012\012        // set the value of the i-solution\012        psolution[i] = total / M_LINEAR_ACCESS(pM, i, i);\012    }\012}\012\012/*\012 * Solving Ax=b using backward substitution\012 * pM - Lower triangular matrix.\012 * Note: we take lower triangular (not upper triangular) to remove the transposition\012 * step required otherwise.\012 */\012inline void solve_backward_substitution(NNLS_LOCAL data_type const * restrict pM, \012                                 NNLS_LOCAL data_type const * restrict pb, \012                                 NNLS_LOCAL data_type *restrict psolution,\012                                 int full_size, int view_size);\012inline void solve_backward_substitution(NNLS_LOCAL data_type const * restrict pM, \012                                 NNLS_LOCAL data_type const * restrict pb, \012                                 NNLS_LOCAL data_type *restrict psolution,\012                                 int full_size, int view_size) {\012    // very last element is trivial\012    psolution[view_size-1] = pb[view_size-1] /\012        M_LINEAR_ACCESS(pM, view_size-1, view_size-1);\012\012    // for the rest\012    for (int i=view_size-2; i>=0; --i) {\012//        data_type total = pb[i];\012        data_type total = 0.0f;\012        for (int j=i+1; j<view_size; ++j) {\012            total += M_LINEAR_ACCESS(pM, j, i) * psolution[j];\012        }\012\012        psolution[i] = (pb[i] - total) / M_LINEAR_ACCESS(pM, i, i);\012    }\012}\012\012inline void permutation_identity(NNLS_LOCAL int *permutation);\012inline void permutation_identity(NNLS_LOCAL int *permutation) {\012#pragma unroll 1\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i)\012        permutation[i] = i;\012}\012\012//\012// debug functions\012//\012#ifdef NNLS_DEBUG\012\012#define PRINT_FLOAT(value) printf(\"%f\\n\", value)\012#define PRINT_DOUBLE(value) printf(\"%e\\n\", value)\012\012void print_vector(data_type const* pv, int size);\012void print_matrix(data_type const *pm, int size);\012void print_permutation(int const *pv, int size);\012void print_gmatrix(__global data_type const *pm, int size);\012void print_vector(data_type const* pv, int size) {\012    for (int i=0; i<size; ++i)\012        PRINT_FLOAT(pv[i]);\012}\012\012void print_matrix(data_type const *pm, int size) {\012    for (int i=0; i<size; ++i) {\012        for (int j=0; j<size; ++j) {\012            printf(\"%f  \", pm[i*NUM_TIME_SAMPLES + j]);\012        }\012        printf(\"\\n\");\012    }\012}\012\012void print_gmatrix(__global data_type const *pm, int size) {\012    for (int i=0; i<size; ++i) {\012        for (int j=0; j<size; ++j) {\012            printf(\"%f  \", pm[i*NUM_TIME_SAMPLES + j]);\012        }\012        printf(\"\\n\");\012    }\012}\012\012void print_permutation(int const *pv, int size) {\012    for (int i=0; i<size; ++i)\012        printf(\"%d\\n\", pv[i]);\012}\012#endif\012\012//\012// fast nnls w/o copying (inplace updates)\012//\012__kernel\012void inplace_fnnls(__global data_type const * restrict A,\012                   __global data_type const * restrict b,\012                   __global data_type *restrict x,\012                   double const epsilon,\012                   unsigned int const max_iterations);\012\012__kernel\012void inplace_fnnls(__global data_type const * restrict A,\012                   __global data_type const * restrict b,\012                   __global data_type *restrict x,\012                   double const epsilon,\012                   unsigned int const max_iterations) {\012#ifdef NNLS_DEBUG\012    printf(\"A = \\n\");\012    print_gmatrix(A, NUM_TIME_SAMPLES);\012#endif\012\012    // initial setup\012    int npassive = 0;\012    NNLS_LOCAL data_type AtA[NUM_TIME_SAMPLES_SQ];\012    NNLS_LOCAL data_type Atb[NUM_TIME_SAMPLES];\012    NNLS_LOCAL data_type s[NUM_TIME_SAMPLES];\012    NNLS_LOCAL data_type w[NUM_TIME_SAMPLES];\012    NNLS_LOCAL data_type final_s[NUM_TIME_SAMPLES];\012    NNLS_LOCAL int permutation[NUM_TIME_SAMPLES];\012    NNLS_LOCAL data_type AtAx[NUM_TIME_SAMPLES];\012    NNLS_LOCAL data_type pL[NUM_TIME_SAMPLES_SQ];\012    NNLS_LOCAL data_type py[NUM_TIME_SAMPLES];\012    transpose_multiply_m_m(A, AtA);\012    transpose_multiply_m_v_v(A, b, Atb);\012    permutation_identity(permutation);\012\012#pragma unroll 1\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i)\012        final_s[i] = x[i];\012\012#ifdef NNLS_DEBUG\012    printf(\"permutaion = \\n\");\012    print_permutation(permutation, NUM_TIME_SAMPLES);\012    printf(\"AtA = \\n\");\012    print_matrix(AtA, NUM_TIME_SAMPLES);\012    printf(\"Atb = \\n\");\012    print_vector(Atb, NUM_TIME_SAMPLES);\012#endif\012\012    // loop over all iterations. \012#pragma unroll 1\012    for (unsigned int iter = 0; iter < max_iterations; ++iter) {\012        int nactive = NUM_TIME_SAMPLES - npassive;\012#ifdef NNLS_DEBUG\012        printf(\"*************\\n\");\012        printf(\"iteration = %d\\n\", iter);\012        printf(\"nactive = %d\\n\", nactive);\012            printf(\"final_s = \\n\");\012            print_vector(final_s, NUM_TIME_SAMPLES);\012#endif\012\012        // exit condition\012        if (!nactive)\012            break;\012\012        // update the gradient vector but only for the active constraints\012        multiply_m_v_v(AtA, final_s, AtAx);\012#ifdef NNLS_DEBUG\012            printf(\"AtAx = \\n\");\012            print_vector(AtAx, NUM_TIME_SAMPLES);\012#endif\012        data_type max_w_value = FLT_MIN; int max_w_idx; \012        int iii = 0;\012#pragma unroll 1\012        for (int i=npassive; i<NUM_TIME_SAMPLES; ++i) {\012            w [ i ] = Atb [ i ] - AtAx [ i ];\012\012            if (iii == 0 || w [ i ] > max_w_value) {\012                max_w_value = w [ i ];\012                max_w_idx = i;\012            }\012            ++iii;\012        }\012\012#ifdef NNLS_DEBUG\012            printf(\"w = \\n\");\012            print_vector(w, NUM_TIME_SAMPLES);\012            printf(\"max_w_value = %f\\n\", max_w_value);\012            printf(\"max_w_idx = %d\\n\", max_w_idx);\012#endif\012\012        // convergence check\012        if (max_w_value < epsilon)\012            break;\012\012        // note, max_w_idx already points to the right location in the vector\012        // run swaps\012        swap_row_column(AtA, npassive, max_w_idx, \012            NUM_TIME_SAMPLES, NUM_TIME_SAMPLES);\012        swap_element(Atb, npassive, max_w_idx);\012        swap_element(final_s, npassive, max_w_idx);\012        swap_perm_element(permutation, npassive, max_w_idx);\012\012#ifdef NNLS_DEBUG\012            printf(\"after swap AtA = \\n\");\012            print_matrix(AtA, NUM_TIME_SAMPLES);\012            printf(\"after swap Atb = \\n\");\012            print_vector(Atb, NUM_TIME_SAMPLES);\012            printf(\"after swap final_s = \\n\");\012            print_vector(final_s, NUM_TIME_SAMPLES);\012            printf(\"after swap permutation = \\n\");\012            print_permutation(permutation, NUM_TIME_SAMPLES);\012#endif\012\012        ++npassive;\012\012        // inner loop\012        int inner_iteration = 0;\012        int position_removed = -1;\012        while (npassive > 0) {\012            if (npassive == 1) {\012                // scalar case\012                data_type l_0_0 = sqrt(AtA[0]);\012                data_type y_0_0 = Atb[0] / l_0_0;\012                pL[0] = l_0_0;\012                py[0] = y_0_0;\012                s[0] = y_0_0 / l_0_0;\012                position_removed = -1;\012#ifdef NNLS_DEBUG\012                    printf(\"npassive == 1 branch\\n\");\012#endif\012            } else {\012                if (inner_iteration == 0) {\012                fused_cholesky_forward_substitution_solver_rcadd(\012                    AtA, pL, Atb, py, NUM_TIME_SAMPLES, npassive);\012                //solve_backward_substitution(pL, py, s, NUM_TIME_SAMPLES, npassive);\012#ifdef NNLS_DEBUG\012                    printf(\"npassive != 1 else inner_iteration == 0 branch\\n\");\012#endif\012                } else {\012                fused_cholesky_forward_substitution_solver_inbetween_removal(\012                    AtA, pL, Atb, py, position_removed, NUM_TIME_SAMPLES, npassive);\012                //solve_backward_substitution(pL, py, s, NUM_TIME_SAMPLES, npassive);\012#ifdef NNLS_DEBUG\012                    printf(\"npassive != 1 else inner_iteration!=0 else branch\\n\");\012#endif\012                }\012                solve_backward_substitution(pL, py, s, NUM_TIME_SAMPLES, npassive);\012            }\012\012#ifdef NNLS_DEBUG\012                printf(\"***** inner iteration %d *****\\n\", inner_iteration);\012                printf(\"L = \\n\");\012                print_matrix(pL, NUM_TIME_SAMPLES);\012                printf(\"s = \\n\");\012                print_vector(s, NUM_TIME_SAMPLES);\012                printf(\"py = \\n\");\012                print_vector(py, NUM_TIME_SAMPLES);\012#endif\012\012            // update the elements from the passive set\012            data_type min_s_value = s [ 0 ];\012#pragma unroll 1\012            for (int i=1; i<npassive; ++i) {\012                if (s [ i ] < min_s_value)\012                    min_s_value = s [ i ];\012            }\012\012#ifdef NNLS_DEBUG\012                printf(\"min_s_value = %f\\n\", min_s_value);\012                printf(\"npassive = %d\\n\", npassive);\012#endif\012\012            // if elements of the passive set are all positive\012            // set the solution vector and break from the inner loop\012            if (min_s_value > 0.0f) {\012#ifdef NNLS_DEBUG\012                printf(\"min_s_value = %f and branching here\\n\", min_s_value);\012#endif\012#pragma unroll 1\012                for (int i=0; i<npassive; ++i)\012                    final_s [ i ] = s [ i ];\012                break;\012            }\012\012#ifdef NNLS_DEBUG\012            if (iter%100 == 0) {\012                printf(\"final_s = \\n\");\012                print_vector(final_s, NUM_TIME_SAMPLES);\012            }\012#endif\012\012            // \012            data_type alpha = FLT_MAX;\012            int alpha_idx = 0;\012#pragma unroll 1\012            for (int i=0; i<npassive; ++i) {\012                if (s [ i ] <= 0.0f) {\012                    data_type const ratio = final_s [ i ] / \012                        ( final_s [ i ] - s [ i ] );\012                    if (ratio < alpha) {\012                        alpha = ratio;\012                        alpha_idx = i;\012                    }\012                }\012            }\012\012            if (alpha == FLT_MAX) {\012#pragma unroll 1\012                for (int i=0; i<npassive; ++i) \012                    final_s [ i ] = s [ i ];\012                break;\012            }\012\012            // update solution using alpha\012#pragma unroll 1\012            for (int i=0; i<npassive; ++i) {\012                final_s [ i ] += alpha * (s [ i ] - final_s [ i ]);\012            }\012            final_s [ alpha_idx] = 0;\012            --npassive;\012\012            // run swaps\012            swap_row_column(AtA, alpha_idx, npassive,\012                NUM_TIME_SAMPLES, NUM_TIME_SAMPLES);\012            swap_element(Atb, npassive, alpha_idx);\012            swap_element(final_s, npassive, alpha_idx);\012            swap_perm_element(permutation, npassive, alpha_idx);\012            inner_iteration++;\012            position_removed = alpha_idx;\012\012#ifdef NNLS_DEBUG\012            printf(\"final_s = \\n\");\012            print_vector(final_s, NUM_TIME_SAMPLES);\012#endif\012        }\012    }\012\012#ifdef NNLS_DEBUG\012    printf(\"final_s = \\n\");\012    print_vector(final_s, NUM_TIME_SAMPLES);\012    printf(\"permutation = \\n\");\012    print_permutation(permutation, NUM_TIME_SAMPLES);\012#endif\012\012    // permute the solution vector back to have x[i] sit at the original position\012#pragma unroll 1\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i) {\012        x [ permutation[i] ] = final_s [i];\012    }\012}\012\012//\012// a wrapper around inplace_fnnls to arrange the data per work item\012//\012/*\012__kernel void inplace_fnnls_facade(__global data_type const *restrict vA,\012                                   __global data_type const *restrict vb,\012                                   __global data_type * restrict vx,\012                                   double const epsilon,\012                                   unsigned int const max_iterations) {\012    // get the global index - identifies the detector channel \012    int idx = get_global_id(0);\012        \012    // get the pointer to the right location for the idx\012    __global data_type const *ptrA = vA + idx * NUM_TIME_SAMPLES_SQ;\012    __global data_type const *ptrb = vb + idx * NUM_TIME_SAMPLES;\012    __global data_type *ptrx = vx + idx * NUM_TIME_SAMPLES;\012\012    for (int i=0; i<NUM_TIME_SAMPLES; ++i)\012        ptrx[i] = 0;\012\012    // launch the fnnls itself for the right worker item\012    inplace_fnnls(ptrA, ptrb, ptrx, epsilon, max_iterations);\012}\012*/\012"}];